measurements.description:
Eighty-five flowers and nine buds on eight erect inflorescences well presented above foliage; 
	five pseudobulbs, 160-cm diameter, 106-cm tall plant grown in a 20-cm round plastic pot;
	sepals and petals cream, suffused dark rose, linear spots, burgundy central lines;
	lip white, bugundy spots, midlobe edged burgundy apically;

	substance firm; texture matte.
